//import Frontend from "./Frontend";
import React from "react";
import './App.css';
class App extends React.Component {



  // ComponentDidMount is used to
  // execute the code 
  componentDidMount() {
    fetch("https://api.documenu.com/restaurants/zip_code/10065?size=10&page=1", {
      "headers": {
        "x-api-key": "82dbeaac7b3078a26ab28e0736ecf8ee"
      }
    })
      .then(response => {
        console.log(response);
      })
      .catch(err => {
        console.error(err);
      })
      .then((res) => res.json())
      .then((json) => {
        this.setState({
          items: json,
          DataisLoaded: true
        });
      })
  }
  render() {


    return (
      <div className="App">
        <h1> Fetch data from an api in react </h1>  {
          items.map((item) => (
            <ol key={item.id} >
              totalResults: {item.name},
              total_pages: {item.cuisine},
              more_pages: {item.geo}
            </ol>
          ))
        }
      </div>
    );
  }
}

export default App;
